import React from 'react';
import Leaderboard from './Leaderboard';

const App = () => {
  const leaderboardData = [
    {
      name: 'Player 1',
      picture: 'player1.jpg',
      points: 1000,
    },
    {
      name: 'Player 2',
      picture: 'player2.jpg',
      points: 900,
    },
    {
      name: 'Player 3',
      picture: 'player3.jpg',
      points: 800,
    },
    // Add more players as needed
  ];

  return (
    <div className="App">
      <Leaderboard data={leaderboardData} />
    </div>
  );
};

export default App;
